import { initializeApp } from "firebase/app";
import { getAuth, GoogleAuthProvider } from "firebase/auth";

// Configuración de Firebase
const firebaseConfig = {
  apiKey: "AIzaSyB_Wo9llwriaOoBmsdtbnm2_OPMrPENHg8", // Tu Web API Key
  authDomain: "prueba-89c20.firebaseapp.com", // Reemplaza con tu Auth Domain
  projectId: "prueba-89c20", // Tu Project ID
  storageBucket: "prueba-89c20.appspot.com", // Opcional: Si usas almacenamiento
  messagingSenderId: "170766382115", // Tu Project Number
  appId: "TU_APP_ID", // Opcional: Si tienes un App ID
};

// Inicializa Firebase
const app = initializeApp(firebaseConfig);

// Exporta la autenticación y el proveedor de Google
export const auth = getAuth(app);
export const googleProvider = new GoogleAuthProvider();
